import React, { useState, useEffect, useRef } from "react";
import { Link, useLocation } from "react-router-dom";
import { FaBars, FaTimes } from "react-icons/fa";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();
  const navbarRef = useRef(null);

  const splitLocation = location.pathname.split("/");

  // Close on outside click
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (navbarRef.current && !navbarRef.current.contains(event.target)) {
        setIsOpen(false);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, []);

  // Close on route change
  useEffect(() => {
    setIsOpen(false);
  }, [location]);

  return (
    <>
      <style>{`
        body {
          margin: 0;
          font-family: Arial, sans-serif;
          background: #f4f6f9;
          color: #111;
        }

        .navbar {
          position: sticky;
          top: 0;
          z-index: 1000;
          backdrop-filter: blur(15px);
          background: rgba(255,255,255,0.95);
          box-shadow: 0 4px 20px rgba(0,0,0,0.08);
        }

        .container {
          display: flex;
          justify-content: space-between;
          align-items: center;
          padding: 15px 20px;
        }

        .logo {
          font-weight: bold;
          font-size: 20px;
          text-decoration: none;
          color: inherit;
        }

        .nav-links {
          display: flex;
          gap: 25px;
          list-style: none;
        }

        .nav-links li {
          position: relative;
        }

        .nav-links a {
          text-decoration: none;
          color: inherit;
          transition: 0.3s ease;
        }

        .nav-links a:hover {
          color: #0d6efd;
        }

        .active {
          font-weight: bold;
          color: #0d6efd !important;
        }

        .hamburger {
          display: none;
          font-size: 22px;
          background: none;
          border: none;
          cursor: pointer;
        }

        .mobile-menu {
          position: fixed;
          top: 0;
          right: 0;
          height: 100vh;
          width: 260px;
          background: rgba(255,255,255,0.95);
          backdrop-filter: blur(20px);
          transform: translateX(100%);
          transition: transform 0.4s ease;
          display: flex;
          flex-direction: column;
          padding-top: 80px;
          box-shadow: -10px 0 30px rgba(0,0,0,0.1);
        }

        .mobile-menu.open {
          transform: translateX(0);
        }

        .mobile-menu a {
          padding: 15px 20px;
          text-decoration: none;
          color: inherit;
        }

        @media (max-width: 768px) {
          .nav-links {
            display: none;
          }
          .hamburger {
            display: block;
          }
        }
      `}</style>

      <nav ref={navbarRef} className="navbar">
        <div className="container">
          <Link to="/" className="logo">DESAM</Link>

          <ul className="nav-links">
            <li>
              <Link to="/" className={splitLocation[1] === "" ? "active" : ""}>
                Home
              </Link>
            </li>

            <li>
              <Link to="/about" className={splitLocation[1] === "about" ? "active" : ""}>
                About
              </Link>
            </li>

            <li>
              <Link to="/services" className={splitLocation[1] === "services" ? "active" : ""}>
                Services
              </Link>
            </li>

            <li>
              <Link to="/contact" className={splitLocation[1] === "contact" ? "active" : ""}>
                Contact
              </Link>
            </li>

            <li>
              <Link to="/AdminDashboard" className={splitLocation[1] === "AdminDashboard" ? "active" : ""}>
                Admin
              </Link>
            </li>
          </ul>

          <button className="hamburger" onClick={() => setIsOpen(!isOpen)}>
            {isOpen ? <FaTimes /> : <FaBars />}
          </button>
        </div>

        <div className={`mobile-menu ${isOpen ? "open" : ""}`}>
          <Link to="/" onClick={() => setIsOpen(false)}>Home</Link>
          <Link to="/about" onClick={() => setIsOpen(false)}>About</Link>
          <Link to="/services" onClick={() => setIsOpen(false)}>Services</Link>
          <Link to="/contact" onClick={() => setIsOpen(false)}>Contact</Link>
          <Link to="/AdminDashboard" onClick={() => setIsOpen(false)}>Admin</Link>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
